import React, { useState } from 'react';
import './App.css';

function App() {
  const [recommendations, setRecommendations] = useState('');
  const [hasClickedRecommend, setHasClickedRecommend] = useState(false);

  const [marketSector, setMarketSector] = useState('healthcare');
  const [holdingPeriod, setHoldingPeriod] = useState('<1');
  const [maxPrice, setMaxPrice] = useState(500);

  const handleSubmit = async () => {
    try {
      const response = await fetch('http://localhost:3001/get-recommendations', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          marketSector: marketSector,
          holdingPeriod: holdingPeriod,
          maxPrice: maxPrice
        })
      });

      if (response.ok) {
        const data = await response.json();
        setRecommendations(data.recommendations);
        setHasClickedRecommend(true);
      } else {
        console.error('Failed to retrieve recommendations');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Generative AI Stock Advisor</h1>
        <form onSubmit={e => e.preventDefault()}></form>
        <div>
        <p>Stock Market Sector</p>
          <select
            id="market-sector"
            value={marketSector}
            onChange={(e) => setMarketSector(e.target.value)}
          >
            <option value="healthcare">Choose One</option>
            <option value="healthcare">Healthcare</option>
            <option value="materials">Materials</option>
            <option value="real-estate">Real Estate</option>
            <option value="consumer-staples">Consumer Staples</option>
            <option value="consumer-discretionary">Consumer Discretionary</option>
            <option value="utilities">Utilities</option>
            <option value="energy">Energy</option>
            <option value="industrials">Industrials</option>
            <option value="consumer-services">Consumer Services</option>
            <option value="financials">Financials</option>
            <option value="technology">Technology</option>
          </select>
        </div>
        <div>
          <p>Holding Period in Years</p>
          <select
            id="holding-period"
            value={holdingPeriod}
            onChange={(e) => setHoldingPeriod(e.target.value)}
          >
            <option value="<1">Choose One</option>
            <option value="<1">Less than 1 year</option>
            <option value="1">1 year</option>
            <option value="2">2 years</option>
            <option value="3">3 years</option>
            <option value="4">4 years</option>
            <option value="2">5 years</option>
            <option value="3">6 years</option>
            <option value="4">7 years</option>
            <option value="2">8 years</option>
            <option value="3">9 years</option>
            <option value="4">10+ years</option>
          </select>
        </div>
        <div>
          <p>Max Price:</p>
          <input
            type="range"
            id="max-price"
            name="max-price"
            min="1"
            max="1000"
            value={maxPrice}
            onChange={(e) => setMaxPrice(parseInt(e.target.value, 10))}
          />
        </div>
        <button className="submit-button" onClick={handleSubmit}>Get Recommendations</button>
        {hasClickedRecommend && (
          <div>
            <h4>Your personalized recommendations:</h4>
            <h6 className="output">{recommendations}</h6>
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
